/*Compute P = rhoRT/W(x) */
void CKPX(double * restrict rho, double * restrict T, double * restrict x, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double XW = 0;/* To hold mean molecular wt */
    XW += x[0]*1.007970; /*H */
    XW += x[1]*15.999400; /*O */
    XW += x[2]*17.007370; /*OH */
    XW += x[3]*33.006770; /*HO2 */
    XW += x[4]*2.015940; /*H2 */
    XW += x[5]*18.015340; /*H2O */
    XW += x[6]*31.998800; /*O2 */
    XW += x[7]*13.019120; /*CH */
    XW += x[8]*14.027090; /*CH2 */
    XW += x[9]*14.027090; /*CH2* */
    XW += x[10]*15.035060; /*CH3 */
    XW += x[11]*29.018520; /*HCO */
    XW += x[12]*30.026490; /*CH2O */
    XW += x[13]*28.010550; /*CO */
    XW += x[14]*44.009950; /*CO2 */
    XW += x[15]*40.021700; /*C2O */
    XW += x[16]*25.030270; /*C2H */
    XW += x[17]*26.038240; /*C2H2 */
    XW += x[18]*27.046210; /*C2H3 */
    XW += x[19]*28.054180; /*C2H4 */
    XW += x[20]*41.029670; /*HCCO */
    XW += x[21]*43.045610; /*CH3CO */
    XW += x[22]*44.053580; /*CH3CHO */
    XW += x[23]*39.057360; /*C3H3 */
    XW += x[24]*40.065330; /*pC3H4 */
    XW += x[25]*40.065330; /*aC3H4 */
    XW += x[26]*41.073300; /*aC3H5 */
    XW += x[27]*41.073300; /*CH3CCH2 */
    XW += x[28]*42.081270; /*C3H6 */
    XW += x[29]*43.089240; /*nC3H7 */
    XW += x[30]*43.089240; /*iC3H7 */
    XW += x[31]*44.097210; /*C3H8 */
    XW += x[32]*56.064730; /*C2H3CHO */
    XW += x[33]*28.013400; /*N2 */
    *P = *rho * 8.31451e+07 * (*T) / XW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void CKPY(double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW = 0;/* for computing mean MW */
    YOW += y[0]*imw[0]; /*H */
    YOW += y[1]*imw[1]; /*O */
    YOW += y[2]*imw[2]; /*OH */
    YOW += y[3]*imw[3]; /*HO2 */
    YOW += y[4]*imw[4]; /*H2 */
    YOW += y[5]*imw[5]; /*H2O */
    YOW += y[6]*imw[6]; /*O2 */
    YOW += y[7]*imw[7]; /*CH */
    YOW += y[8]*imw[8]; /*CH2 */
    YOW += y[9]*imw[9]; /*CH2* */
    YOW += y[10]*imw[10]; /*CH3 */
    YOW += y[11]*imw[11]; /*HCO */
    YOW += y[12]*imw[12]; /*CH2O */
    YOW += y[13]*imw[13]; /*CO */
    YOW += y[14]*imw[14]; /*CO2 */
    YOW += y[15]*imw[15]; /*C2O */
    YOW += y[16]*imw[16]; /*C2H */
    YOW += y[17]*imw[17]; /*C2H2 */
    YOW += y[18]*imw[18]; /*C2H3 */
    YOW += y[19]*imw[19]; /*C2H4 */
    YOW += y[20]*imw[20]; /*HCCO */
    YOW += y[21]*imw[21]; /*CH3CO */
    YOW += y[22]*imw[22]; /*CH3CHO */
    YOW += y[23]*imw[23]; /*C3H3 */
    YOW += y[24]*imw[24]; /*pC3H4 */
    YOW += y[25]*imw[25]; /*aC3H4 */
    YOW += y[26]*imw[26]; /*aC3H5 */
    YOW += y[27]*imw[27]; /*CH3CCH2 */
    YOW += y[28]*imw[28]; /*C3H6 */
    YOW += y[29]*imw[29]; /*nC3H7 */
    YOW += y[30]*imw[30]; /*iC3H7 */
    YOW += y[31]*imw[31]; /*C3H8 */
    YOW += y[32]*imw[32]; /*C2H3CHO */
    YOW += y[33]*imw[33]; /*N2 */
    *P = *rho * 8.31451e+07 * (*T) * YOW; /*P = rho*R*T/W */

    return;
}


/*Compute P = rhoRT/W(y) */
void VCKPY(int * restrict np, double * restrict rho, double * restrict T, double * restrict y, int * iwrk, double * restrict rwrk, double * restrict P)
{
    double YOW[*np];
    for (int i=0; i<(*np); i++) {
        YOW[i] = 0.0;
    }

    for (int n=0; n<34; n++) {
        for (int i=0; i<(*np); i++) {
            YOW[i] += y[n*(*np)+i] * imw[n];
        }
    }

    for (int i=0; i<(*np); i++) {
        P[i] = rho[i] * 8.31451e+07 * T[i] * YOW[i]; /*P = rho*R*T/W */
    }

    return;
}


/*Compute P = rhoRT/W(c) */
void CKPC(double * restrict rho, double * restrict T, double * restrict c, int * iwrk, double * restrict rwrk, double * restrict P)
{
    int id; /*loop counter */
    /*See Eq 5 in CK Manual */
    double W = 0;
    double sumC = 0;
    W += c[0]*1.007970; /*H */
    W += c[1]*15.999400; /*O */
    W += c[2]*17.007370; /*OH */
    W += c[3]*33.006770; /*HO2 */
    W += c[4]*2.015940; /*H2 */
    W += c[5]*18.015340; /*H2O */
    W += c[6]*31.998800; /*O2 */
    W += c[7]*13.019120; /*CH */
    W += c[8]*14.027090; /*CH2 */
    W += c[9]*14.027090; /*CH2* */
    W += c[10]*15.035060; /*CH3 */
    W += c[11]*29.018520; /*HCO */
    W += c[12]*30.026490; /*CH2O */
    W += c[13]*28.010550; /*CO */
    W += c[14]*44.009950; /*CO2 */
    W += c[15]*40.021700; /*C2O */
    W += c[16]*25.030270; /*C2H */
    W += c[17]*26.038240; /*C2H2 */
    W += c[18]*27.046210; /*C2H3 */
    W += c[19]*28.054180; /*C2H4 */
    W += c[20]*41.029670; /*HCCO */
    W += c[21]*43.045610; /*CH3CO */
    W += c[22]*44.053580; /*CH3CHO */
    W += c[23]*39.057360; /*C3H3 */
    W += c[24]*40.065330; /*pC3H4 */
    W += c[25]*40.065330; /*aC3H4 */
    W += c[26]*41.073300; /*aC3H5 */
    W += c[27]*41.073300; /*CH3CCH2 */
    W += c[28]*42.081270; /*C3H6 */
    W += c[29]*43.089240; /*nC3H7 */
    W += c[30]*43.089240; /*iC3H7 */
    W += c[31]*44.097210; /*C3H8 */
    W += c[32]*56.064730; /*C2H3CHO */
    W += c[33]*28.013400; /*N2 */

    for (id = 0; id < 34; ++id) {
        sumC += c[id];
    }
    *P = *rho * 8.31451e+07 * (*T) * sumC / W; /*P = rho*R*T/W */

    return;
}


