    result += y[16]*ums[16]*imw[16]; /*C2H */
    result += y[17]*ums[17]*imw[17]; /*C2H2 */
    result += y[18]*ums[18]*imw[18]; /*C2H3 */
    result += y[19]*ums[19]*imw[19]; /*C2H4 */
