    nuki[ 0 * kd + 23 ] += -1 ;
    nuki[ 6 * kd + 23 ] += -1 ;
    nuki[ 1 * kd + 23 ] += +1 ;
    nuki[ 2 * kd + 23 ] += +1 ;

    /*reaction 25: O + H2 <=> H + OH */
    nuki[ 1 * kd + 24 ] += -1 ;
    nuki[ 4 * kd + 24 ] += -1 ;
    nuki[ 0 * kd + 24 ] += +1 ;
    nuki[ 2 * kd + 24 ] += +1 ;

    /*reaction 26: OH + H2 <=> H + H2O */
    nuki[ 2 * kd + 25 ] += -1 ;
    nuki[ 4 * kd + 25 ] += -1 ;
    nuki[ 0 * kd + 25 ] += +1 ;
    nuki[ 5 * kd + 25 ] += +1 ;

    /*reaction 27: 2 OH <=> O + H2O */
    nuki[ 2 * kd + 26 ] += -2 ;
    nuki[ 1 * kd + 26 ] += +1 ;
    nuki[ 5 * kd + 26 ] += +1 ;

    /*reaction 28: 2 H + H2 <=> 2 H2 */
    nuki[ 0 * kd + 27 ] += -2 ;
    nuki[ 4 * kd + 27 ] += -1 ;
    nuki[ 4 * kd + 27 ] += +2 ;

    /*reaction 29: 2 H + H2O <=> H2 + H2O */
    nuki[ 0 * kd + 28 ] += -2 ;
    nuki[ 5 * kd + 28 ] += -1 ;
    nuki[ 4 * kd + 28 ] += +1 ;
    nuki[ 5 * kd + 28 ] += +1 ;

    /*reaction 30: 2 H + CO2 <=> H2 + CO2 */
    nuki[ 0 * kd + 29 ] += -2 ;
    nuki[ 14 * kd + 29 ] += -1 ;
    nuki[ 4 * kd + 29 ] += +1 ;
    nuki[ 14 * kd + 29 ] += +1 ;

    /*reaction 31: H2 + O2 <=> HO2 + H */
    nuki[ 4 * kd + 30 ] += -1 ;
