    nuki[ 3 * kd + 30 ] += +1 ;
    nuki[ 0 * kd + 30 ] += +1 ;

    /*reaction 32: HO2 + H <=> O + H2O */
    nuki[ 3 * kd + 31 ] += -1 ;
    nuki[ 0 * kd + 31 ] += -1 ;
