    nuki[ 2 * kd + 40 ] += -1 ;
    nuki[ 14 * kd + 40 ] += +1 ;
    nuki[ 0 * kd + 40 ] += +1 ;

    /*reaction 42: CO + O2 <=> CO2 + O */
    nuki[ 13 * kd + 41 ] += -1 ;
    nuki[ 6 * kd + 41 ] += -1 ;
    nuki[ 14 * kd + 41 ] += +1 ;
