        Kc_s[64*npt+i] = exp((g_RT[9*npt+i] + g_RT[33*npt+i]) - (g_RT[8*npt+i] + g_RT[33*npt+i]));
        Kc_s[65*npt+i] = exp((g_RT[0*npt+i] + g_RT[9*npt+i]) - (g_RT[4*npt+i] + g_RT[7*npt+i]));
