        Kc_s[67*npt+i] = exp((g_RT[1*npt+i] + g_RT[9*npt+i]) - (g_RT[0*npt+i] + g_RT[11*npt+i]));
        Kc_s[68*npt+i] = exp((g_RT[2*npt+i] + g_RT[9*npt+i]) - (g_RT[0*npt+i] + g_RT[12*npt+i]));
        Kc_s[69*npt+i] = exp((g_RT[4*npt+i] + g_RT[9*npt+i]) - (g_RT[0*npt+i] + g_RT[10*npt+i]));
        Kc_s[70*npt+i] = refC * exp((g_RT[6*npt+i] + g_RT[9*npt+i]) - (g_RT[0*npt+i] + g_RT[2*npt+i] + g_RT[13*npt+i]));
